import React, { Component } from 'react';
import Sidebar from "./components/Sidebar"

class Main extends Component {
    render() {
        return (
            <div>
                <Sidebar pageWrapId={"page-wrap"} outerContainerId={"App"} />

                <div id="page-wrap">
                    <h1>리액트</h1>
                </div>
            </div>
        );
    }
}

export default Main;
